INSERT INTO `l2_test_cases` VALUES (1,'member_add','empi','To Verify if empi is blank in L2.member table on the basis of local_member_id','select local_member_id, count(distinct local_member_id) as c from l2.member_add where empi = \'\' or empi is null group by local_member_id  having c>0',0,'2019-12-23 08:01:40','2019-12-23 08:27:11','1'),(2,'member_add','empi','To Verify if empi is blank in L2.member table on the basis of birth_date','select birth_date, count(distinct birth_date) as c from l2.member_add where empi = \'\' or empi is null group by birth_date having c>0',0,'2019-12-23 08:01:40','2019-12-23 08:27:11','1'),(3,'member_add','empi','To verify empi should be unique for each patient','select count(distinct local_member_id ||birth_date) as c, empi from l2.member_add group by empi having c>1',1,'2019-12-23 08:01:40','2019-12-23 08:01:40','1'),(4,'member_add','local_member_id','To verify if one local_member_id is having more then one empi','select local_member_id, count(distinct empi) as c from l2.member_add group by local_member_id having c>0',0,'2019-12-23 08:01:40','2019-12-23 08:01:40','1'),(5,'member_add','local_member_id','To verify if one local_member_id is having more then one birth_date','select local_member_id,count(distinct birth_date) as c from l2.member_add group by local_member_id having c>1',1,'2019-12-23 08:01:40','2019-12-23 08:01:40','1'),(6,'member_add','local_member_id','To verify if local_member_id is blank or null on the basis of empi','select empi, count(distinct empi) as c from l2.member_add where local_member_id = \'\' or local_member_id is null group by empi having c>0',0,'2019-12-23 08:01:40','2019-12-23 08:27:11','1'),(7,'member_add','zip_full','To verify that 9 digit zip should be present','select count(*) as c,empi from l2.member_add where len(zipfull)!=\'9\' group by empi having c>0',0,'2019-12-23 08:01:40','2019-12-23 08:01:40','1'),(8,'member_add','city','To verify if the city is blank on the basis of empi','select count(distin